Product Description French:
@Risk est un outil d’analyse des risques puissant, flexible et convivial qui comporte des caractéristiques de conception qui le rendent plus agréable pour les utilisateurs qui ne sont pas des statisticiens de métier. Cet outil permet aux cadres intermédiaires et supérieurs d’utiliser et d’articuler les données en temps opportun.
@Risk permet au client de réaliser des projets tels les calculateurs réglementaires et les CBA.  Le Bureau du contrôleur général a élaboré une Ligne directrice sur l’attestation du dirigeant principal des finances (DPF) pour les présentations au Cabinet. @Risk sert également à l’attestation du DPF pour les présentations au Conseil du Trésor et les MC destinés au Ministre, au Conseil du Trésor et au Cabinet.
@Risk fournit au client les outils visant à évaluer les risques liés aux programmes et leurs incidences financières, à mener des analyses des risques et à mesurer les résultats comportementaux compte tenu des modifications dans des apports incertains en exécutant des simulations dites « de Monte Carlo ».
Ce produit est la norme gouvernementale pour les attestations du DPF et est utilisé dans plus de 18 ministères.
